import React, { useState, FC } from 'react';
import TJ1 from '../../assets/JeanAndTom/front-before.jpg';
import TJ2 from '../../assets/JeanAndTom/front-mid.jpg';
import TJ3 from '../../assets/JeanAndTom/backyard-before.jpg';
import TJ4 from '../../assets/JeanAndTom/backyard-after.jpg';
import TJ5 from '../../assets/JeanAndTom/back-looking-at-house-before.jpg';
import TJ6 from '../../assets/JeanAndTom/back-looking-at-house-after.jpg';
import tala1 from '../../assets/Tala-sized/gravel-before.jpg';
import tala2 from '../../assets/Tala-sized/gravel-after.jpg';
import tala3 from '../../assets/Tala-sized/front-before.jpg';
import tala4 from '../../assets/Tala-sized/front-after.jpg';
import tala5 from '../../assets/Tala-sized/back-planters-before.jpg';
import tala6 from '../../assets/Tala-sized/back-planters-after.jpg';
import Scroller from '../Scroller';

interface BeforeAfterProps {
  caption: string;
  before: PictureProps;
  after: PictureProps;
}
interface PictureProps {
  src: string;
}
interface ProjectProps {
  title: string;
  hours: number;
  photos: BeforeAfterProps[];
}

enum BeforeAfter {
  Before = 'before',
  After = 'after',
}

const Projects: FC = () => {
  const [toggleStatus, setToggleStatus] = useState(BeforeAfter.Before);
  const handleToggle = () => {
    setToggleStatus(
      toggleStatus === BeforeAfter.After
        ? BeforeAfter.Before
        : BeforeAfter.After
    );
  };
  const projects: ProjectProps[] = [
    {
      title: 'Deep weeding',
      hours: 50,
      photos: [
        {
          caption: 'Carved out wanted vegetation & redefined rock borders',

          before: {
            src: TJ1,
          },
          after: {
            src: TJ2,
          },
        },
        {
          caption:
            'Cleared all weeds down fence line and start defining back lawn borders',
          before: {
            src: TJ3,
          },
          after: {
            src: TJ4,
          },
        },
        {
          caption: 'Dug backyard down to dirt, prepping for landscaping',
          before: { src: TJ5 },
          after: {
            src: TJ6,
          },
        },
      ],
    },
    {
      title: 'Weeding & Gravel',
      hours: 30,
      photos: [
        {
          caption:
            'Removed weeds from gravel, cleared raised beds, defined plants & new gravel',

          before: {
            src: tala1,
          },
          after: {
            src: tala2,
          },
        },
        {
          caption:
            'Removed weeds and trimmed plants, chainsaw unwanted pear tree.',
          before: {
            src: tala3,
          },
          after: {
            src: tala4,
          },
        },
        {
          caption: 'Removed all weeds and vegetation around raised beds',
          before: {
            src: tala5,
          },
          after: {
            src: tala6,
          },
        },
      ],
    },
  ];

  const articles = [
    {
      title: 'Article 1',
      imageUrl:
        'https://st.hzcdn.com/fimgs/pictures/landscapes/window-view-from-japanese-style-home-hanselman-landscape-and-gardens-img~e651fb31083467df_3477-1-8137125-w360-h360-b0-p0.jpg',
    },
    {
      title: 'Article 2',
      imageUrl:
        'https://st.hzcdn.com/fimgs/pictures/landscapes/bayside-david-r-lamb-landscape-architect-img~e0f1b8d904bed430_1400-1-f731f5d-w360-h360-b0-p0.jpg',
    },
    {
      title: 'Article 3',
      imageUrl:
        'https://st.hzcdn.com/fimgs/pictures/landscapes/mid-century-river-house-carbo-landscape-architecture-img~eb61355c08ac5c0e_3696-1-52bf005-w360-h360-b0-p0.jpg',
    },
    {
      title: 'Masterpiece',
      imageUrl:
        'https://st.hzcdn.com/fimgs/4251422502f52f1c_5549-w360-h360-b0-p0--.jpg',
    },
    {
      title: 'Japanese Garden Style',
      imageUrl:
        'https://st.hzcdn.com/fimgs/pictures/landscapes/japanese-style-landscaping-dabah-landscape-designs-img~9a811b2a0159e310_2458-1-f56bebf-w360-h360-b0-p0.jpg',
    },

    // Add more articles as needed
  ];

  return (
    <div className='projects'>
      <h1>Projects</h1>

      <div className='toggle-switch'>
        <label className='switch'>
          <input
            type='checkbox'
            onChange={handleToggle}
            checked={toggleStatus === BeforeAfter.After}
          />
          <span className='slider'></span>
        </label>
      </div>
      {projects.map((project, i) => (
        <div key={i}>
          <h2>
            {project.title} - {project.hours} hours
          </h2>

          {project.photos.map((photo, i) => (
            <div key={i} className='card'>
              <div
                className={`card-image ${
                  toggleStatus === BeforeAfter.Before ? 'before' : 'after'
                }`}
                onClick={handleToggle}
              >
                <img
                  src={photo.before.src}
                  alt={photo.caption}
                  style={{
                    opacity: toggleStatus === BeforeAfter.Before ? 1 : 0,
                  }}
                />
                <span className='card-title'>
                  <h2 className='shadow'>foo</h2>
                  {photo.caption}
                </span>
                <img
                  src={photo.after.src}
                  alt={photo.caption}
                  style={{
                    opacity: toggleStatus === BeforeAfter.After ? 1 : 0,
                  }}
                />
              </div>

              {/* <p>
                {toggleStatus === BeforeAfter.Before
                  ? 'Before: ' + photo.caption
                  : 'After: ' + photo.caption}
              </p> */}
            </div>
          ))}
        </div>
      ))}
    </div>
  );
};

export default Projects;
